import React from 'react';
import { Marker as LeafletMarker, Popup as LeafletPopup} from 'react-leaflet'


const Marker = ({ name, coordinates, onClick, active} ) => (

	<LeafletMarker 
		position={coordinates}
		onClick={onClick}
	>
		<LeafletPopup>
			<p style={{ 'color': active ? 'red' : 'black' }}>{name}</p>
		</LeafletPopup>

	</LeafletMarker>
)

export default Marker
